    def reset(self):
        Keithley.breaker = 0
        self.ptr = 0
        time.sleep(1)
        Keithley.reset()
        Keithley.promptoff()
        self.contador = -1
        self.tempo = []
        self.desligaPlot = 0
        self.timer.stop()
        self.timerPulse.stop()
        self.timerSetChannels.stop()
        print("resetado")
    def setValues(self):
        self.contador +=  1
        if self.contador==len(self.cores):
            self.contador = 0

    def desenhaCurva(self, curva):
        k = 0
        for n in range(curva+1):
            #mutex.lock()
            self.p1.plot(Keithley.vd1[n-1], Keithley.id1[n-1], pen=pg.mkPen('{}'.format(self.cores[k]), width=2), name='curva {}'.format(n))
            self.p2.plot(Keithley.vd1[n-1], np.log10(np.abs(Keithley.id1[n-1])), pen=pg.mkPen('{}'.format(self.cores[k]), width=2))
            self.p3.plot(Keithley.vd1[n-1], Keithley.ig2[n-1], pen=pg.mkPen('{}'.format(self.cores[k]), width=2))
            self.p4.plot(Keithley.vd1[n-1], np.log10(np.abs(Keithley.ig2[n-1])), pen=pg.mkPen('{}'.format(self.cores[k]), width=2))
            #mutex.unlock()
            k += 1
            if k == len(self.cores):
                k = 0
    def update(self):
        print('funcionando 1')
        if self.desligaPlot == 1 and Keithley.breaker == 1:
            print('funcionando')
            self.p1.clear()
            self.p2.clear()
            self.p3.clear()
            self.p4.clear()
            mutex.lock()
            #print('LEN2 {} {}'.format(len(self.v), len(self.ig)))
            self.p1.plot(Keithley.vd1[Keithley.curva-1], Keithley.id1[Keithley.curva-1], pen=pg.mkPen('{}'.format(self.cores[self.contador]), width=2))
            self.p2.plot(Keithley.vd1[Keithley.curva-1], np.log10(np.abs(Keithley.id1[Keithley.curva-1])), pen=pg.mkPen('{}'.format(self.cores[self.contador]), width=2))
            self.p3.plot(Keithley.vd1[Keithley.curva-1], Keithley.ig2[Keithley.curva-1], pen=pg.mkPen('{}'.format(self.cores[self.contador]), width=2))
            self.p4.plot(Keithley.vd1[Keithley.curva-1], np.log10(np.abs(Keithley.ig2[Keithley.curva-1])), pen=pg.mkPen('{}'.format(self.cores[self.contador]), width=2))
            mutex.unlock()
            if Keithley.curva >0:
                self.desenhaCurva(Keithley.curva-1)





        elif Keithley.breaker == 0:
            self.p1.clear()
            self.p2.clear()
            self.p3.clear()
            self.p4.clear()
            self.p5.clear()
            self.p6.clear()
            if Keithley.curva >0:
                self.desenhaCurva(Keithley.curva-1)

        elif self.desligaPlot == 0:
            self.p1.clear()
            self.p2.clear()
            self.p3.clear()
            self.p4.clear()

    def updatePulse(self):
        if self.desligaPlot == 2:
            self.p5.clear()
            self.p6.clear()
            end2 = time.time()
            self.tempo.append(end2-self.ptr)
            Keithley.getCurrent(self.k, self.k)
            self.p5.plot(self.tempo, Keithley.id1, pen=pg.mkPen('b'), width=2)
            self.p6.plot(self.tempo, Keithley.ig2, pen=pg.mkPen('b'), width=2)
            self.k = self.k + 1
            print(self.k)



    def checagemPulsado(self):
        if self.desligaPlot == 2:
            end = time.time()
            print('Segundos: '+ str(round(end - self.ptr)))
            if self.checkBox_7.checkState() == 2 and self.checkBox_8.checkState() == 2:
                if (round(end-self.ptr)%int(self.lineEdit_15.text())) == 0:
                    if self.canalA_Pulsado == 0:
                        Keithley.setChannelA(float(self.lineEdit_13.text()))
                        self.canalA_Pulsado = 1

                    elif self.canalA_Pulsado == 1:
                        Keithley.setChannelA(float(self.lineEdit_14.text()))
                        self.canalA_Pulsado = 0

                if (round(end-self.ptr)%int(self.lineEdit_18.text())) == 0:
                    if self.canalB_Pulsado == 0:
                        Keithley.setChannelB(float(self.lineEdit_16.text()))
                        self.canalB_Pulsado = 1

                    elif self.canalB_Pulsado == 1:
                        Keithley.setChannelB(float(self.lineEdit_17.text()))
                        self.canalB_Pulsado = 0

            elif self.checkBox_7.checkState() == 2:
                if (round(end-self.ptr)%float(self.lineEdit_15.text())) == 0:
                    print('foi 1')
                    if self.canalA_Pulsado == 0:
                        print('foi 2')
                        Keithley.setChannelA(float(self.lineEdit_13.text()))
                        self.canalA_Pulsado = 1

                    elif self.canalA_Pulsado == 1:
                        print('foi 3')

                        Keithley.setChannelA(float(self.lineEdit_14.text()))
                        self.canalA_Pulsado = 0

            elif self.checkBox_8.checkState() == 2:

                if (round(end-self.ptr)%int(self.lineEdit_18.text())) == 0:
                    if self.canalB_Pulsado == 0:
                        Keithley.setChannelB(float(self.lineEdit_16.text()))
                        self.canalB_Pulsado = 1
                    elif self.canalB_Pulsado == 1:
                        Keithley.setChannelB(float(self.lineEdit_17.text()))
                        self.canalB_Pulsado = 0
            else:
                Keithley.setChannels(self.lineEdit_11.text(), self.lineEdit_12.text(), self.combobox_autorange[self.comboBox_3.currentText()], self.combobox_autorange[self.comboBox_4.currentText()])



